import {
  createBrowserRouter,
  RouterProvider,
  Outlet,
} from "react-router-dom";
import Footer from "./components/Footer"
import Navbar from "./components/Navbar"
import Home from "./pages/Home"

// admin pages
import SignUp from "./admin/SignUp";
import SignIn from "./admin/SignIn";
import Dashboard from "./admin/Dashboard";

const Layout=()=>{
  return(
    <div className="app">
      <Navbar />
      <Outlet />
      <Footer />
    </div>
  )
}

const router=createBrowserRouter([
  {
    path:"/",
    element:<Layout />,
    children:[
      {
        path:"/",
        element:<Home />
      },
      {
        path:"/admin",
        element:<Dashboard />
      },
      {
        path:"admin/signup",
        element:<SignUp />
      },
      {
        path:"admin/signin",
        element:<SignIn />
      }
    ]
  }
])

function App() {
  return (
    <div>
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
